import ReactPlayer from 'react-player';
import "./movie.css"

function Watch() {
    return (
        <div className="playercontainer" style={{backgroundColor: "#000"}}>

        

        <div></div>

       <ReactPlayer className="watchplayer"
          width="100%"
          height="720px"
          controls
          url="https://youtu.be/EMzgOCHzPMs"/>

            
        </div>
    )
}

export default Watch
